  ,\n\t\"SPFSpecialistNNACVReportingBase\",\n\t\"SPFSpecialistReportingStartDate\"\
  ,\n\t\"SPFSpecialistForecastID\",\n\t\"SPFOwnerID\"\n) as -- SEMANTIC LAYER BEGINS\n\
  \nSELECT \"SN_TERRITORYNAME\" as \"SPFTerritoryName\",\n       \"SN_TERRITORY\"\
  \ as \"SPFTerritoryGUID\",\n       \"SN_BUSINESSUNITNAME\" as \"SPFBusinessUnitName\"\
  ,\n       \"SN_BUSINESSUNIT\" as \"SPFBusinessUnitGUID\",\n       \"SN_OPPORTUNITYNAME\"\
