  \ as \"SPFSpecialistNNACVReporting\",\n       \"STATECODENAME\" as \"SPFStateCodeName\"\
  ,\n       \"SN_SPECIALISTFORECASTCATEGORYREPORTINGNAME\" as \"SPFForecastCategoryReportingName\"\
  ,\n       \"SN_OPPORTUNITYPRODUCTSTARTDATE\" as \"SPFOpportunityProductStartDate\"\
  ,\n       \"OWNERIDNAME\" as \"SPFOwnerIDName\",\n       \"SN_SPECIALISTFORECASTCATEGORYNAME\"\
  \ as \"SPFForecastCategoryName\",\n       \"MODIFIEDBYNAME\" as \"SPFModifiedByName\"\
  ,\n       \"CREATEDBYNAME\" as \"SPFCreatedByName\",\n       \"SN_SPECIALISTSTARTDATE\"\
  \ as \"SPFSpecialistStartDate\",\n       \"MODIFIEDON\" as \"SPFModifiedOn\",\n\
  \       \"SN_FORECASTTYPENAME\" as \"SPFForecastTypeName\",\n       \"SN_BURISKNAME\"\
  \ as \"SPFBURiskName\",\n       \"SN_BUDOWNSELLLOSTRISKCATEGORYNAME\" as \"SPFBUDownsellLostRiskCategoryName\"\
  ,\n       \"SN_BUDOWNSELLLOSTRISKISSUENAME\" as \"SPFBUDownsellLostRiskIssueName\"\
  ,\n       \"SN_BUDOWNSELLLOSTRISKOTHERREASON\" as \"SPFBUDownsellLostRiskOtherReason\"\
  ,\n       \"CREATEDON\" as \"SPFCreatedOn\",\n       \"SN_PRODUCTNNACV_BASE\" as\
  \ \"SPFProductNNACVBase\",\n       \"SN_PRODUCTNNACV\" as \"SPFProductNNACV\",\n\
  \       \"SN_SPECIALISTFORECASTNNACV_BASE\" as \"SPFSpecialistForecastNNACVBase\"\
  ,\n       \"SN_SPECIALISTFORECASTNNACV\" as \"SPFSpecialistForecastNNACV\",\n  \
  \     \"SN_SPECIALISTNNACVREPORTING_BASE\" as \"SPFSpecialistNNACVReportingBase\"\
  ,\n       \"SN_SPECIALISTSTARTDATEREPORTING\" as \"SPFSpecialistReportingStartDate\"\
  ,\n       \"SN_SPECIALISTFORECASTID\" as \"SPFSpecialistForecastID\",\n       \"\
  OWNERID\" as \"SPFOwnerID\"\nFROM RDS.\"DYNAMICS365\".\"SN_SPECIALISTFORECASTS\"\
  ;"
